    return (
      <div className="App">
        <Navbar>
          <h1>Clicky Game!</h1>
          <div className="collapse navbar-collapse" id="navbarMenu">
            <ul className="navbar-nav ml-auto">
              <li className="nav-item">
                <a className="nav-link" href="#">Current Score: {this.state.currentscore}</a>
              </li>
              <li className="nav-item">
                <a className="nav-link" href="#">High Score:{this.state.highscore}</a>
              </li>
            </ul>
          </div>
        </Navbar>
        <Instructions />
        <Cardgroup />
      </div >
    );
  }
}

export default App;
